import React, { Component } from "react";
import { Icon, Card } from 'antd'

class Nav extends Component {
    render() {
        return (
            <div style={{ fontSize: "24px" }}>
                <Card>
                    <a href=""><Icon type="ordered-list" /></a>
                    <div> <a href="/sale">สินค้า</a></div>
                </Card>

            </div>)
    }
}
export default Nav;
